 マーカーランプ
 ＥＶＡ泥除け

本製品は丸型路肩灯および白熱球式ワークランプに
装着されている白熱球と交換するＬＥＤバルブです。

<BR>
本製品が使用できる路肩灯は小糸製丸型路肩灯および
板橋用品製フルメッキ路肩灯Ｂ型、ワークランプは小型角ワークランプＡタイプ、Ｂタイプ等白熱球式のものです。
<BR><BR>
色温度： 6000K相当 <BR>
定格： DC24V約250ｍA　約6W <BR>
口金サイズ： BA15S <BR>
本体サイズ： 74ｍｍΦ <BR>
使用推奨商品： 小糸製丸型路肩灯/ 板橋製フルメッキ路肩/小型角ワークランプDS-022・026等 
<BR><BR>
★取付方法<BR><BR>

１．バルブの熱を十分に冷まして下さい。<BR>
２．電球交換と同様の手順で取付けする器具を分解し、白熱球を取外し本製品と交換し て下さい。<BR>
３．点灯確認後、分解した器具を元通りに戻して下さい。
<BR><BR>
★ご注意<BR><BR>

・火傷の原因となりますので、バルブ交換の際は、バルブの熱が十分に冷めてから作業を行って下さい。<BR>
・本製品を直視しないで下さい。視力に悪影響をおよぼす恐れがあります。<BR>
・本製品の分解、改造等は危険ですので絶対におやめ下さい。<BR>
・本製品は自動車用路肩灯交換用バルブです。<BR>
それ以外の用途での使用はおやめ下さい。<BR>
また、本製品と取付けする車両の電圧が同じであることを必ず確認して下さい。<BR>
・経年変化や使用状況等により、LEDや本体が劣化、退色、減光する場合がございます。<BR>
またLEDには色のばらつきがございます。<BR>
予めご了承下さい。<BR>
・ランプ内に水が浸入し、本製品が濡れたまま使用しますと、ショートや故障の原因となります。本製品に防水機能はありません。<BR>
・本製品の使用でラジオやカーナビ、車載リモコンやバックカメラ等に ノイズが発生する場合がございます。予めご了承下さい。<BR>
・誤った使用によって発生した故障や事故等につきましては当社では一切の責任を負いかねます。<BR>
また、本製品の不良は現品交換のみとさせていただきます。<BR>
その他の保証は一切致しませんので予めご了承下さい。
<BR><BR>
メーカー名：株式会社ジェットイノウエ
